/* Generated File Run.js in Project tes */	function close_tes(){	Minimizer.close("tes");}	function minimize_tes(){	Minimizer.minimize("tes");}	function maximize_tes(){	Minimizer.maximize("tes");}function open_tes(){}/* Initialize application */			function init_tes(){	$("#body-tes").keypress(function(event) {	}).mouseover(function(){	    $("#tes-container").draggable({disabled:true});    }).mouseout(function(){        $("#tes-container").draggable({disabled:false});    });		$("#tes-container").mousedown(function(){		Focus.set("tes");		setMenu_tes();			fixSizetesSpeed = 0;	})	.mouseup(function(){		fixSizetesSpeed = 300;	});		/* Make application resizable */	Resizable.set("tes");		$("#exit-tes").mousedown(function(){		close_tes();		$("#body-tes").val("");	});	$("#maximize-tes").mousedown(function(){		maximize_tes()	});		$("#minimize-tes").mousedown(function(){		minimize_tes()	});			fixSize_tes();}/* Fix size application */var fixSizetesSpeed = 300;function fixSize_tes(){	setTimeout(function(){		if(LoadAppsID["tes"].onFocus){			height = $("#tes-container").height();			width = $("#tes-container").width();			$("#body-tes").css({"height" : height-45, "width" : width-5});		}		fixSize_tes();	},fixSizetesSpeed);}/* Set application menu */function setMenu_tes(){	proIdApps = "tes";	var valMenu = "<span id=top-menu-item0 class=top-menu-item>tes</span>"+        "<ul id=top-menu-item0-down class=top-menu-item-down>"+            "<li onclick=minimize_tes(proIdApps)>Minimize</li>"+			"<li onclick=maximize_tes(proIdApps)>Maximize</li>"+			"<li onclick=close_tes(proIdApps)>Quit tes</li>"+        "</ul>";		$("#top-menu").html(valMenu);		Menu.fixedTopMenu();}/* Register application */function register_tes(){	$.post("system/applications/tes/layout/tes.html", function(data){		ApplicationRun[applicationOpened] = data;		ApplicationRun[applicationOpened] = ApplicationRun[applicationOpened];		$(".program").html(($(".program").html())+ApplicationRun[applicationOpened]);		setTimeout(init_tes,100);		fixSize_tes();		applicationOpened++;	});	}/* Running application */function run_tes(dir, fileName){}